    public void testVersionedGsonMixingSinceAndUntilSerialization_999() {
        com.google.gson.Gson gson = builder.setVersion(1.0).create();
        com.google.gson.functional.VersioningTest_testVersionedGsonMixingSinceAndUntilSerialization_1000.SinceUntilMixing target = new com.google.gson.functional.VersioningTest_testVersionedGsonMixingSinceAndUntilSerialization_1000.SinceUntilMixing();
        java.lang.String json = gson.toJson(target);
        junit.framework.Assert.assertFalse(json.contains("\"b\":" + com.google.gson.functional.VersioningTest_testVersionedGsonMixingSinceAndUntilSerialization_1000.B));
        gson = builder.setVersion(1.2).create();
        json = gson.toJson(target);
        junit.framework.Assert.assertTrue(json.contains("\"b\":" + com.google.gson.functional.VersioningTest_testVersionedGsonMixingSinceAndUntilSerialization_1000.B));
        gson = builder.setVersion(1.3).create();
        json = gson.toJson(target);
        junit.framework.Assert.assertFalse(json.contains("\"b\":" + com.google.gson.functional.VersioningTest_testVersionedGsonMixingSinceAndUntilSerialization_1000.B));
    }

